answer:
Reformatted Question: 
In quadrilateral $<fact1>ABCD</fact1>$, angle $<fact2>BAD</fact2>$ and angle $<fact3>CDA</fact3>$ are trisected as shown. What is the degree measure of angle $<fact4>AFD</fact4>$?

[asy]
size(150);
pair A , B, C, D; A = (0,0); B = (2, 4); C = (7,4); D = (7, -2);
draw( (0,0)--(2,4) -- (7,4) -- (7, -2)-- cycle);
label("$A$", A, SW);
label("$B$", B, NW);
label("$C$", C, NE);
label("$D$", D, SE);
pair E, F;
E = (4.5-.2,1-.2); F = (5, 3);
draw(A--E--D); draw(A--F--D);
label("$E$", E, N); label("$F$", F, NW);
dot(A);dot(B);dot(C);dot(D);dot(E);dot(F);
label("$x$", (1, 1.5), S); label("$x$", (2, 1), S+W); label("$x$", (2, -1), N+N+N+W);
label("$y$", (5.5+.3, .5-.3), S); label("$y$", (6.5+.3, 0)); label("$y$", (5+.5, -1.5+.3));
label("$110^{\circ}$",(2.5,3.5)); label("$100^{\circ}$",(6.5-.2,3.5));
[/asy]
Answer: 
Since the angles in a quadrilateral add up to $360^{\circ}$, we have $x + x + x + 110^{\circ} + 100^{\circ} = 360^{\circ}$, so $3x + 210^{\circ} = 360^{\circ}$, and $3x = 150^{\circ}$, so $x = 50^{\circ}$. Therefore, $\angle DAE = 2x = 100^{\circ}$. Similarly, $3y + 100^{\circ} + 110^{\circ} = 360^{\circ}$, so $3y + 210^{\circ} = 360^{\circ}$, and $3y = 150^{\circ}$, so $y = 50^{\circ}$. Therefore, $\angle AFD = 180^{\circ} - \angle DAE - \angle FDA = 180^{\circ} - 100^{\circ} - 50^{\circ} = \boxed{30^{\circ}}$.

