Answer: The area of the gray piece is equal to the area of the <fact6>square</fact6> minus the areas of the two <fact4>isosceles</fact4> triangles. The area of the <fact6>square</fact6> is <fact3>16 square inches</fact3>. Each <fact4>isosceles</fact4> triangle has a base of length 4 and a height of 2, so each triangle has an area of 4. Therefore, the area of the gray piece is 16 - 4 - 4 = 8 square inches.

