Answer: 
We have that $<fact1>AD=BD=CD</fact1>$, so $\triangle ADB$ and $\triangle ADC$ are isosceles. Thus, $\angle BAD=\angle ADB$ and $\angle CAD=\angle ADC$. Since $\angle BCA = 40^\circ$, we have $\angle CAD+\angle ADB=40^\circ$. Since $\angle BAC=\angle BAD+\angle CAD$, we have $\angle BAC+\angle ADB=80^\circ$. Since $\angle BAC=\angle BAD=\angle ADB$, we have $\angle BAC+\angle BAC=80^\circ$. Therefore, $\angle BAC=40^\circ$.

