A square and an equilateral triangle have	equal	perimeters.	The area of the triangle is $16\sqrt{3}$ square centimeters. How long, in centimeters, is a diagonal of the square? Express your answer in simplest radical form.

[asy]
defaultpen(linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
pair a = (1.25,0)+1.25*dir(60);
pair b = a+1.25*dir(-60);
draw((1.25,0)--a--b--cycle);

[/asy]

answer:
Formatted Question: 
A <fact1>square</fact1> and an <fact2>equilateral triangle</fact2> have equal <fact3>perimeters</fact3>. The <fact4>area of the triangle</fact4> is $16\sqrt{3}$ square centimeters. How long, in centimeters, is a <fact5>diagonal of the square</fact5>? Express your answer in simplest radical form.

[asy]
defaultpen(linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
pair a = (1.25,0)+1.25*dir(60);
pair b = a+1.25*dir(-60);
draw((1.25,0)--a--b--cycle);

[/asy]

Answer: 
Let $x$ denote the side length of the <fact1>square</fact1>. Then, the <fact3>perimeter</fact3> of the <fact1>square</fact1> is $4x$ centimeters. Since the <fact1>square</fact1> and the <fact2>equilateral triangle</fact2> have equal <fact3>perimeters</fact3>, the <fact3>perimeter</fact3> of the <fact2>equilateral triangle</fact2> is also $4x$ centimeters. Therefore, each side length of the <fact2>equilateral triangle</fact2> is $\frac{4x}{3}$ centimeters. Since the <fact4>area of the triangle</fact4> is $16\sqrt{3}$ square centimeters, we have \begin{align*} \frac{\sqrt{3}}{4} \left(\frac{4x}{3}\right)^2 &= 16\sqrt{3}\\ \Rightarrow\qquad \frac{\sqrt{3}}{4} \cdot \frac{16x^2}{9} &= 16\sqrt{3}\\ \Rightarrow\qquad \frac{4x^2}{9} &= 16\\ \Rightarrow\qquad x^2 &= 36\\ \Rightarrow\qquad x &= 6. \end{align*}Finally, the length of a <fact5>diagonal of the square</fact5> is $6\sqrt{2}$ centimeters.

