answer:
Reformatted Question: 
In the diagram below, we have <fact1>$\overline{ST}\parallel\overline{QR}$</fact1>, <fact2>$\angle P= 40^\circ$</fact2>, and <fact3>$\angle Q =35^\circ$</fact3>. Find the measure of <fact4>$\angle STR$</fact4> in degrees.

[asy]
pair P,Q,R,SS,T;
Q = (0,0);
R = (1,0);
P = (1.1,0.5);
SS = 0.6*P;
T = R + 0.6*(P-R);
draw(T--SS--P--R--Q--SS);
label("$P$",P,N);
label("$S$",SS,NW);
label("$Q$",Q,S);
