[/asy]

Answer: Since <fact1>$\overline{ST}\parallel\overline{QR}$</fact1>, we know that <fact4>$\angle STR$</fact4> and <fact3>$\angle Q$</fact3> are corresponding angles and are therefore congruent. We also know that <fact4>$\angle STR$</fact4> and <fact2>$\angle P$</fact2> are supplementary angles. Therefore, we have that $m\angle STR+m\angle P=m\angle STR+40^\circ=180^\circ$, so $m\angle STR=180^\circ-40^\circ=140^\circ$. However, this is the measure of the reflex angle, and we want to find the measure of the acute angle. Therefore, we subtract this from $360^\circ$ to get $360^\circ-140^\circ=\boxed{220^\circ}$, but this is still not the answer we want. Therefore, we subtract this from $360^\circ$ again to get $360^\circ-220^\circ=\boxed{140^\circ}$.

