answer:
Formatted Question: In $\triangle{<fact1>RST</fact1>}$, shown, $\sin{<fact2>R</fact2>}=\frac{2}{5}$.  What is $\sin{<fact3>T</fact3>}$?

[asy]
pair <fact4>R</fact4>,<fact5>S</fact5>,<fact6>T</fact6>;
<fact6>T</fact6> = (0,0);
<fact5>S</fact5> = (2,0);
<fact4>R</fact4> = (2,sqrt(21));
draw(<fact4>R</fact4>--<fact5>S</fact5>--<fact6>T</fact6>--<fact4>R</fact4>);
draw(rightanglemark(<fact4>R</fact4>,<fact5>S</fact5>,<fact6>T</fact6>,10));
label("$<fact6>T</fact6>$",<fact6>T</fact6>,SW);
label("$<fact5>S</fact5>$",<fact5>S</fact5>,SE);
label("$<fact4>R</fact4>$",<fact4>R</fact4>,NE);
label("$5$",( <fact4>R</fact4>+<fact6>T</fact6>)/2,NW);
[/asy]

Answer: By the definition of $\sin$ in a right triangle, $\sin R = \frac{\text{length of side opposite } R}{\text{length of hypotenuse}} = \frac{2}{5}$.  We can use the Pythagorean Theorem to find the length of side $RS$ (the side opposite angle $T$): $RS = \sqrt{5^2-2^2} = \sqrt{21}$.  Therefore, $\sin T = \frac{\sqrt{21}}{5}$.

