Answer: Since $\overline{BC}$ is parallel to the segment through $A$, we have that $\angle ABC = \angle BAC$ <fact1>by the Alternate Interior Angles Theorem</fact1>. Since $AB = BC$, we have that $\angle BCA = \angle BAC$ <fact2>by the Isosceles Triangle Theorem</fact2>. Therefore, $\angle ABC = \angle BCA = \angle BAC$, so $\triangle ABC$ is <fact3>isosceles</fact3>. Since the <fact4>base angles</fact4> of an isosceles triangle are equal, we have that $x = \angle ABC = \boxed{124^{\circ}/2=62^{\circ}}$ <fact5>by the Base Angles Theorem</fact5>.

