answer:
Formatted Question: 
A rectangular field is enclosed in an <fact1>athletic track</fact1>, as shown below.  The track consists of two edges of the field, and two <fact2>semicircles</fact2>.  The <fact3>length of the track</fact3> is <fact4>400 meters</fact4>.  What is the largest possible <fact5>area of the field</fact5>, in square meters?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

Answer: 
The <fact3>length of the track</fact3> is the sum of the two straight sides of the rectangle and the two <fact2>semicircles</fact2>.  Let $r$ be the radius of the <fact2>semicircles</fact2>, and let $x$ be the length of the straight sides of the rectangle.  Then the <fact3>length of the track</fact3> is $2x+2\pi r$, and we are given that this is equal to <fact4>400 meters</fact4>.  The <fact5>area of the field</fact5> is $A=2r\cdot x$.  We can solve for $x$ in terms of $r$ using the equation $2x+2\pi r = 400$, obtaining $x=\frac{400-2\pi r}{2}=200-\pi r$.  Then the <fact5>area of the field</fact5> is $A=2r(200-\pi r)=400r-2\pi r^2$.  To find the maximum value of $A$, we take the derivative of $A$ with respect to $r$, obtaining $\frac{dA}{dr}=400-4\pi r$.  Setting this equal to zero, we find that $r=\frac{400}{4\pi}=\frac{100}{\pi}$.  The maximum <fact5>area of the field</fact5> is then $A=400\cdot \frac{100}{\pi}-2\pi\left(\frac{100}{\pi}\right)^2=\frac{40000}{\pi}-\frac{20000}{\pi}=\frac{20000}{\pi}$.

Formatted Question: Let $f(x) = x^{10}+5x^9-8x^8+7x^7-x^6-12x^5+4x^4-8x^3+12x^2-5x-5$. Without using long division (which would be horribly nasty!), find the remainder when $f(x)$ is divided by $x^2-1$.

Answer: Since $x^2-1=(x-1)(x+1)$, we know that the remainder of $f(x)$ divided by $x^2-1$ must be linear (i.e., of the form $ax+b$).  By the <fact1>Factor Theorem</fact1>, we know that $f(1)$ and $f(-1)$ are the remainders when $f(x)$ is divided by $x-1$ and $x+1$, respectively.  Therefore, we can write \begin{align*}
f(x)&=(x-1)(x+1)q(x)+ax+b\\
f(1)&=a+b\\
f(-1)&=-a+b
\end{align*}where $q(x)$ is some polynomial.  Therefore, we have \begin{align*}
a+b&=f(1)=1+5-8+7-1-12+4-8+12-5-5=\\boxed{-10}\\
-a+b&=f(-1)=1-5-8-7-1-12+4+8+12+5-5=\\boxed{-8}
\end{align*}Solving this system of equations, we find that $a=-1$ and $b=-9$, so the remainder is $-x-9$.
